inline ll add(ll a, ll b)
{
ll c = ((a % mod) + (b % mod)) % mod;
return c;
}

inline ll mult(ll a, ll b)
{
ll c = ((a % mod) * (b % mod)) % mod;
return c;
}

void init()
{
iota(root, root + maxs, 0);
}
ll find(ll u)
{
ll f;
if (root[u] == u)
return u;
else
{
ll f = find(root[u]);
root[u] = f;
return f;
}
}
void Union(ll x, ll y)
{
ll u = find(x);
ll v = find(y);
root[v] = u;
}
ll power(ll x, ll y, ll p)
{
ll res = 1;
x = x % p;
while (y > 0)
{
if (y & 1)
res = (res * x) % p;

y = y >> 1;
x = (x * x) % p;
}
return res;
}
void update(vector<ll>& BIT, ll ind, ll val)
{
// ind : 1 based
// val - arr[i] or count
while (ind < BIT.size())
{
BIT[ind] += val;
ind += (ind & (-ind));
}
}
ll query(vector<ll>& BIT, ll ind)
{
ll sum = 0;
while (ind > 0)
{
sum += BIT[ind];
ind -= (ind & (-ind));
}
return sum;
}

bool solve(ll val, vector<pair<ll, ll>>& arr, ll tot)
{
ll n = arr.size();
ll mid = (n + 1) / 2;
ll sum = 0;
for (auto i : arr)
{
if (mid > 0 && i.ss >= val)
{
sum += max(i.ff, val);
mid--;
}
else
sum += i.ff;
}

return mid <= 0 && sum <= tot;
}

