int cnt = 0;
for (int i = 0; i < n; i++)
{
low[i] = a[i].first;
s -= low[i];
if (low[i] >= mid)
cnt++;
}
if (cnt > n / 2)
return true;
for (int i = n - 1; i >= 0; i--)
{
