const int MOD = 998244353;
const int N = 1e6 + 7;
const int INF = 2e9 + 3;


int bin_pow(int a, int n)
{
int res = 1;
while (n)
{
if (n & 1)
res = (1ll * res * a) % MOD;
a = (1ll * a * a) % MOD;
n >>= 1;
}
return res;
}


void solve()
{
int n;
cin >> n;
vector<int> cnt_item_owner(N);
vector<vector<int>> lst(n);
for (int i = 0; i < n; i++)
{
int k, x;
cin >> k;
for (int j = 0; j < k; j++)
{
cin >> x;
lst[i].push_back(x);
cnt_item_owner[x]++;
}
}
int ans = 0;
for (int i = 0; i < n; i++)
{
for (int x : lst[i])
{
int k = lst[i].size();
int q = bin_pow((1ll * n * n * k) % MOD, MOD - 2);
int cur = (1ll * cnt_item_owner[x] * q) % MOD;
ans = (ans + cur) % MOD;
}
}
cout << ans;
}


