const int p = 998244353;
const int lim = 1e6 + 5;

ll expo(ll a, ll b)
{
ll res = 1;
while (b > 0)
{
if (b & 1)
res = (res * a) % p;

b /= 2;
a = (a * a) % p;
}
return res;
}

ll inv(ll num)
{
return expo(num, p - 2);
}

int freq[lim];
ll demand[lim];

void pre_io()
{
ios_base::sync_with_stdio(false);
cin.tie(NULL);
cout.tie(NULL);
}

int32_t main()
{
pre_io();
int n;
cin >> n;
vector<vector<int>> v(n);
for (int i = 0; i < n; i++)
{
int x;
cin >> x;
v[i].resize(x);
for (int j = 0; j < x; j++)
{
cin >> v[i][j];
freq[v[i][j]]++;
}
}

for (int i = 0; i < n; i++)
{
for (int j = 0; j < v[i].size(); j++)
{
demand[v[i][j]] = (demand[v[i][j]] + inv(v[i].size())) % p;
}
}

ll cons = inv(n);

for (int i = 1; i < lim; i++)
{
if (demand[i] == 0 || freq[i] == 0)
continue;

