{
if (!a)
return (b);
else
return (hcf(b % a, a));
}

ll findGCD(vector<ll> arr, ll n)
{
ll result = arr[0];
for (ll i = 1; i < n; i++)
{
result = hcf(arr[i], result);

if (result == 1)
{
return 1;
}
}
return result;
}

ll lcm(ll a, ll b)
{
return ((a * b) / hcf(a, b));
}

ll modInverse(ll a, ll m)
{
ll m0 = m;
ll y = 0, x = 1;

if (m == 1)
return 0;

while (a > 1)
{
// q is quotient
ll q = a / m;
ll t = m;

// m is remainder now, process same as
// Euclid's algo
m = a % m, a = t;
t = y;

// Update y and x
y = x - q * y;
x = t;
}

// Make x positive
if (x < 0)
x += m0;

return x;
}


