{
float a2 = sqrt(a);
float b2 = sqrt(b);
float c2 = sqrt(c);
// apply cosine law
float alpha = acos((b + c - a) / (2 * b2 * c2));
float beta = acos((a + c - b) / (2 * a2 * c2));
float gamma = acos((b + a - c) / (2 * b2 * a2));
alpha *= (180 / 3.14);
beta *= (180 / 3.14);
gamma *= (180 / 3.14);
cout << alpha << " " << beta << " " << gamma << "\n";
}
ll diff(ll n)
{
ll area = (int)sqrt(n);
ll l, b;
for (ll i = area; i >= 1; --i)
{
if (n % i == 0)
{
l = n / i;
b = i;
break;
}
}
return (l - b);
}

ll xor_n(ll n)
{
ll x = (n % 4);
if (x == 0)
{
return n;
}
else if (x == 1)
{
return 1;
}
else if (x == 2)
{
return n + 1;
}
else if (x == 3)
{
return 0;
}
}
ll recursive(ll n)
{
if (n == 0 || n == 1)
{
return n;
}
else
{
return recursive(n - 1) + recursive(n - 2);
}
}
