/* These template codes have been taken from cp-algorithms */
ll extEuclid(ll a, ll b, ll& x, ll& y)
{
if (b == 0)
{
x = 1;
y = 0;
return a;
}

ll x1, y1;
ll d = extEuclid(b, a % b, x1, y1);
x = y1;
y = x1 - (a / b) * y1;
return d;
}

ll modInverse(ll a, ll n)
{
ll x, y;
extEuclid(a, n, x, y);
return x;
}

ll linearCong(ll a, ll b, ll n)
{
ll d = __gcd(a, n);

if (b % d)
return -1;
a /= d;
b /= d;
n /= d;
ll a_inv = modInverse(a, n);
ll ans = (b * a_inv) % n;
if (ans < 0)
ans += n;
return ans;
}

