unordered_map<string, int> mp;

int removeAdjHelper(string s)
{

if (s.length() <= 1)
{
return 0;
}

if (mp.find(s) != mp.end())
{
return mp[s];
}
string newStr = s;
int totalRes = 0;

for (int i = 0; i < s.length(); i++)
{
if (i + 1 < s.length() and (s[i] == s[i + 1] + 1))
{

newStr = s.substr(0, i) + s.substr(i + 1);
// cout << newStr << endl ;
int curRes = 1 + removeAdjHelper(newStr);
totalRes = max(totalRes, curRes);
}
else if (i - 1 >= 0 and (s[i] == s[i - 1] + 1))
{
// cout << newStr << endl ;
newStr = s.substr(0, i) + s.substr(i + 1);
int curRes = 1 + removeAdjHelper(newStr);
totalRes = max(totalRes, curRes);
}
}

return mp[s] = totalRes;
}

int removeAdjHelper2(string s)
{

char mxC = 'a';
int i = -1;
int removes = 0;
for (int j = 0; j < s.length(); j++)
{
if (j + 1 < s.length() and (s[j] == s[j + 1] + 1))
{
if (s[j] > mxC)
{
mxC = s[j];
i = j;
}
}
if (j - 1 >= 0 and (s[j] == s[j - 1] + 1))
{
if (s[j] > mxC)
{
mxC = s[j];
i = j;
}
}
}

if (i != -1)
{
string newStr = s.substr(0, i) + s.substr(i + 1);
removes = 1 + removeAdjHelper2(newStr);
}
return removes;
}

