const int MAXN = 1e6 + 5;

class SegmentTree
{
vector<long long> tree, pos;

public:
SegmentTree(int n)
{
tree.assign(4 * n, 0);
pos.assign(4 * n, 0);
}
void update(int node, int b, int e, int idx, int val)
{
/// cout << node << " " << b << " " << e << " " << idx << "\n";
if (idx < b || idx > e)
{
return;
}
else if (b == e)
{
/// cout << b << "\n";
tree[node] += val;
pos[node] = tree[node] > 0 ? 1 : 0;
}
else
{
int mid = (b + e) / 2;
update(2 * node, b, mid, idx, val);
update(2 * node + 1, mid + 1, e, idx, val);
tree[node] = tree[2 * node] + tree[2 * node + 1];
pos[node] = pos[2 * node] + pos[2 * node + 1];
}
}
long long query(int node, int b, int e, int l, int r)
{
if (e < l || b > r)
{
/// cout << b << " " << e << " " << l << " " << r << endl;
return 0;
}
else if (l <= b && e <= r)
{
/// cout << b << " " << e << " " << l << " " << r << " " << pos[node] << endl;
return pos[node];
}
else
{
int mid = (b + e) / 2;
return query(2 * node, b, mid, l, r) + query(2 * node + 1, mid + 1, e, l, r);
}
}
};

