#include <bits/stdc++.h>
using namespace std;
#define all(v) (v).begin(), (v).end()
using ll = long long;

int KMAX = 1000000;

class SegmentTree
{
public:
SegmentTree()
{
t.resize(4 * KMAX);
}

// Adds val to element at a certain index
void update(int idx, int val)
{
return update(1, 0, KMAX - 1, idx, val);
}

// Gets sum in segment [left, right]
int sum(int left, int right)
{
return sum(1, 0, KMAX - 1, left, right);
}

private:
// Invariant: tl <= idx <= tr
void update(int v, int tl, int tr, int idx, int new_val)
{
if (tl == tr)
{
t[v] = new_val;
return;
}
int mid = (tl + tr) / 2;
if (idx <= mid)
{
update(2 * v, tl, mid, idx, new_val);
}
else
{
update(2 * v + 1, mid + 1, tr, idx, new_val);
}
t[v] = t[2 * v] + t[2 * v + 1];
}

// t[v] corresponds to [tl, tr]
// Invariant: tl <= ql, qr <= tr
int sum(int v, int tl, int tr, int ql, int qr)
{
if (tl == ql && tr == qr)
{
return t[v];
}

int mid = (tl + tr) / 2;
if (qr <= mid)
{
return sum(2 * v, tl, mid, ql, qr);
}
else if (ql >= mid + 1)
{
return sum(2 * v + 1, mid + 1, tr, ql, qr);
}
return sum(2 * v, tl, mid, ql, mid) + sum(2 * v + 1, mid + 1, tr, mid + 1, qr);
}

vector<int> t;
};

int n, m;
// idx = x coordinate, value = ylo, yhi
vector<std::pair<int, int>> vlines;
// idx = x coordinate, value = y coordinates of lines with left endpoint at idx
vector<vector<int>> hlines_left;
// idx = x coordinate, value = y coordinates of lines with right endpoint at idx
vector<vector<int>> hlines_right;
ll num_sections = 1;

void Load()
{
vlines.resize(KMAX + 1);
hlines_left.resize(KMAX + 1);
hlines_right.resize(KMAX + 1);

scanf("%d%d", &n, &m);
for (int i = 0; i < n; ++i)
{
int y, lx, rx;
scanf("%d%d%d", &y, &lx, &rx);
hlines_left[lx].push_back(y);
hlines_right[rx].push_back(y);
if (lx == 0 && rx == KMAX)
{
num_sections++;
}
}
for (int i = 0; i < m; ++i)
{
int x, ly, ry;
scanf("%d%d%d", &x, &ly, &ry);
vlines[x] = make_pair(ly, ry);
if (ly == 0 && ry == KMAX)
{
num_sections++;
}
}
}

void Solve()
{
SegmentTree segment_tree = SegmentTree();

for (int x = 0; x <= KMAX; ++x)
{
for (int y : hlines_left[x])
{
segment_tree.update(y, 1);
}
if (vlines[x] != make_pair(0, 0))
{
int yhi = vlines[x].second;
if (yhi == KMAX)
{
yhi--;
}
num_sections += segment_tree.sum(vlines[x].first, yhi);
}
for (int y : hlines_right[x])
{
segment_tree.update(y, 0);
}
}
printf("%lld\n", num_sections);
}

int main()
{
Load();
Solve();
}
