int Ans[MAXN * 31], ls[MAXN * 31], rs[MAXN * 31];
void clear()
{
memset(Ans, 0, sizeof(Ans));
tot = 0;
memset(rt, 0, sizeof(rt));
}
void build(int& k, int l, int r)
{
k = ++tot;
if (l == r)
return;
int mid = (l + r) >> 1;
build(ls[k], l, mid);
build(rs[k], mid + 1, r);
}
void Add(int p, int& q, int l, int r, int ps)
{
q = ++tot;
ls[q] = ls[p], rs[q] = rs[p], Ans[q] = Ans[p] + 1;
if (l == r)
return;
int mid = (l + r) >> 1;
if (ps <= mid)
Add(ls[p], ls[q], l, mid, ps);
if (mid < ps)
Add(rs[p], rs[q], mid + 1, r, ps);
}
int Query(int k, int l, int r, int x, int y)
{
if (!k)
return 0;
if (x <= l && r <= y)
return Ans[k];
int mid = (l + r) >> 1, res = 0;
if (x <= mid)
res += Query(ls[k], l, mid, x, y);
if (mid < y)
res += Query(rs[k], mid + 1, r, x, y);
return res;
}
} S;
