class BIT
{
vector<long long> tree;

public:
BIT(int n)
{
tree.assign(n, 0);
}
long long read(int idx)
{
long long val = 0;
while (idx > 0)
{
val += tree[idx];
idx -= (idx & (-idx));
}
return val;
}
void write(int idx, int val)
{
while (idx < tree.size())
{
tree[idx] += val;
idx += (idx & -idx);
}
}
};

