vector<int> A[N], R[N];
vector<pair<int, int>> her[N];
ll n, m, dp[4 * N], ans = 0;
void upd(int i, int l, int r, int pos, int val)
{
if (l == r)
{
dp[i] += val;
return;
}
int m = (l + r) / 2;
if (pos <= m)
upd(i * 2, l, m, pos, val);
else
upd(i * 2 + 1, m + 1, r, pos, val);
dp[i] = dp[i * 2] + dp[i * 2 + 1];
}
ll get(int i, int l, int r, int x, int y)
{
if (x <= l && r <= y)
return dp[i];
if (r < x || l > y)
return 0;
int m = (l + r) / 2;
return get(i * 2, l, m, x, y) + get(i * 2 + 1, m + 1, r, x, y);
}
