#include <iostream>
#include <algorithm>
using namespace std;

const int maxN = 1e5 + 10;
const long long INF = 3e18;

int n;
long long a[maxN], b[maxN], k, ans = 0;

long long calc(long long a, long long b)
{
return a - 3 * b * b + 3 * b - 1;
}

long long bin_search(long long a, long long lim)
{
long long l = 0, r = a;
long long ans = 0;
while (l <= r)
{
long long m = (l + r) / 2;
long long tmp = calc(a, m); // a - 3*m*m + 3*m - 1;
if (tmp >= lim)
{
ans = max(ans, m);
l = m + 1;
}
else
r = m - 1;
}
return ans;
}

bool check(long long lim)
{
ans = 0;
for (int i = 1; i <= n; ++i)
ans += (b[i] = bin_search(a[i], lim));
return ans >= k;
}

void solve()
{
long long l = -INF, r = INF;
while (l <= r)
{
long long m = (l + r) / 2;
if (check(m))
l = m + 1;
else
r = m - 1;
// cout << m << ' ' << ans << '\n';
}
check(r);
// cout << r << '\n';
ans -= k;
for (int i = 1; i <= n; ++i)
{
if (ans && calc(a[i], b[i]) == r)
{
--b[i];
--ans;
}
cout << b[i] << ' ';
}
}

int main()
{
cin >> n >> k;
for (int i = 1; i <= n; ++i)
cin >> a[i];
solve();
