// =-3x^2+3x-1+ai
// decrease
long long cal(long long ai, long long x)
{
return -3 * x * x + 3 * x + ai - 1;
}
vector<int> getall(long long value)
{
vector<int> ret;
for (int i = 0; i < n; i++)
{
long long l = 0, r = a[i];
while (l < r)
{
if (l + 1 == r)
{
if (cal(a[i], r) >= value)
l++;
else
r--;
break;
}
long long mid = (l + r) / 2;
if (cal(a[i], mid) >= value)
l = mid;
else
r = mid;
}
ret.push_back(l);
}
return ret;
}
// cal ai <= value
bool judge(long long value)
{
long long sum = 0;
auto tmp = getall(value);
for (auto x : tmp)
sum += x;
return sum >= k;
}
