using ll = long long;

const ll oo = 8e18;
const int N = 100005;

int n;
ll k;

int a[N];
int b[N];

ll f(int id, ll x)
{
return x * (a[id] - x * x);
}
ll f1(int id, ll x)
{
return a[id] - 3 * x * x + 3 * x - 1;
}

ll solve(ll m)
{
ll ans = 0;
for (int i = 0; i < n; i++)
{
int lo = 1, hi = a[i];
b[i] = 0;
while (lo <= hi)
{
int mid = lo + (hi - lo) / 2;
if (f1(i, mid) >= m)
{
b[i] = mid;
lo = mid + 1;
}
else
{
hi = mid - 1;
}
}
ans += b[i];
}

return ans;
}

