for (int i = 0; i < n; i++)
scanf("%d", a + i);

ll lo = -oo, hi = ll(1e12), ans = -oo;
while (lo <= hi)
{
ll mid = lo + (hi - lo) / 2;
if (solve(mid) >= k)
ans = mid, lo = mid + 1;
else
hi = mid - 1;
}

ll extra = solve(ans) - k;
assert(extra >= 0);

assert(extra <= n);

priority_queue<pair<ll, int>> pq;
for (int i = 0; i < n; i++)
if (b[i])
{
ll val = -f1(i, b[i]);
pq.emplace(val, i);
}

while (extra--)
{
int i = pq.top().second;
pq.pop();
b[i]--;
if (b[i] > 0)
{
ll val = -f1(i, b[i]);
pq.emplace(val, i);
}
}


