{
#ifndef ONLINE_JUDGE
freopen("1.in", "r", stdin);
#endif
n = in;
k = lin;
for (int i = 1; i <= n; i++)
a[i] = in;
ll l = inf, r = 0;
for (int i = 1; i <= n; i++)
l = min(l, f(a[i], a[i] - 1)), r = max(r, f(a[i], 0));
ll ans = r;
while (l <= r)
{
ll mid = l + r >> 1;
if (check(mid))
r = mid - 1;
else
l = mid + 1;
}
ans = l;
check(ans);
k -= s;
for (int i = 1; i <= n; i++)
while (k > 0 && b[i] < a[i] && f(a[i], b[i]) == ans)
b[i]++, k--;
for (int i = 1; i <= n; i++)
printf("%d%c", b[i], " \n"[i == n]);
return 0;
}
